#!/bin/bash

# ----------------------------------------------------------------------
# XCP-ng vGPU Enablement Patch
# ----------------------------------------------------------------------
# This script checks the XCP-ng version and applies the appropriate
# patch. It supports versions 8.2 and 8.3 only.
#
# Any use, copying, distribution, modification, or redistribution of
# this software is strictly prohibited. This software is provided
# as-is, without warranty of any kind, express or implied, including
# but not limited to the warranties of merchantability, fitness for a
# particular purpose, and noninfringement. In no event shall the
# authors be liable for any claim, damages, or other liability, whether
# in an action of contract, tort, or otherwise, arising from, out of,
# or in connection with the software or the use or other dealings in
# the software.
# ----------------------------------------------------------------------

# Base64 encoded patches
encoded_patch_82=""
encoded_patch_83=""

# Function to print a formatted message
print_message() {
  local message=$1
  local type=$2

  case $type in
    "info")
      echo -e "\e[32m[INFO]\e[0m $message"
      ;;
    "warning")
      echo -e "\e[33m[WARNING]\e[0m $message"
      ;;
    "error")
      echo -e "\e[31m[ERROR]\e[0m $message"
      ;;
    *)
      echo -e "\e[34m[MESSAGE]\e[0m $message"
      ;;
  esac
}

# Function to decode and apply patch
apply_patch() {
  local encoded_patch=$1
  local patch_name=$2
  local patch_path="/tmp/$patch_name"

  # Decode the base64 string to a file
  print_message "Decoding patch..." "info"
  echo "$encoded_patch" | base64 --decode > "$patch_path"

  # Apply the patch
  print_message "Applying patch..." "info"
  if sudo rpm -ivh "$patch_path"; then
    print_message "Patch applied successfully." "info"
  else
    print_message "Failed to apply patch." "error"
    exit 1
  fi

  # Clean up
  rm "$patch_path"
  print_message "Cleaned up temporary files." "info"
}

# Get the release version
release_version=$(lsb_release -r | awk '{print $2}')
print_message "Detected XCP-ng version: $release_version" "info"

# Check the release version and apply the appropriate patch
if [[ $release_version == 8.2* ]]; then
  print_message "Version 8.2 detected. Proceeding with patch." "info"
  apply_patch "$encoded_patch_82" "patch-8.2"
elif [[ $release_version == 8.3* ]]; then
  print_message "Version 8.3 detected. Proceeding with patch." "info"
  apply_patch "$encoded_patch_83" "patch-8.3"
else
  print_message "Unsupported XCP-ng version: $release_version" "error"
  exit 1
fi

print_message "Patch script completed." "info"
